import React from "react";
// import * as React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import "./App.css";

import { ChakraProvider } from "@chakra-ui/react";

ReactDOM.render(
  <ChakraProvider>
    <App />
  </ChakraProvider>,
  document.getElementById("root")
);
